    const rating = /^\/restaurant\/[a-zA-Z0-9]*\/rating\/[a-zA-Z0-9]*$/
    const restaurantsInCategory = /^\/category\/[a-zA-Z0-9]*\/restaurant\/$/
    const menuItemInCategory = /^\/category\/[a-zA-Z0-9]*\/menuItem\/$/
    const restaurantCategories = /^\/category\/restaurant$/
    const menuItemCategories = /^\/category\/menuItem$/
    const allRaters = /^\/rater\/$/
    const rater = /^\/rater\/[a-zA-Z0-9]*$/

    if(allRestaurants.test(url))
    {
      var returnArray = this.restaurants
      return JSON.parse(JSON.stringify(returnArray))
    }
    else if (restaurant.test(url))
    {
      var workingArray = this.restaurants
      const restaurantID = url.split("/")[1]
      workingArray = workingArray.filter((item) => { return item.RestaurantID == restaurantID })
      const item = workingArray.length == 1 ? workingArray[0] : null
      return item ? JSON.parse(JSON.stringify(item)) : null
    }
    else if (allMenuItems.test(url))
    {
      var workingArray = this.menuItems
      const restaurantID = url.split("/")[1]
      workingArray = workingArray.filter((item) => { return item.RestaurantID == restaurantID })
      return JSON.parse(JSON.stringify(workingArray))
    }
    else if (menuItem.test(url))
    {
      var workingArray = this.menuItems
      const restaurantID = url.split("/")[1]
      const menuItemID = url.split("/")[3]
      workingArray = workingArray.filter((item) => { return item.RestaurantID == restaurantID && item.ItemID == menuItemID })
      const item = workingArray.length == 1 ? workingArray[0] : null
      return JSON.parse(JSON.stringify(item))
    }
    else if (allRatings.test(url))
    {
      var workingArray = this.ratings
      const restaurantID = url.split("/")[1]
      workingArray = workingArray.filter((item) => { return item.RestaurantID == restaurantID })
      return JSON.parse(JSON.stringify(workingArray))
    }
    else if (rating.test(url))
    {
      var workingArray = this.ratings
      const restaurantID = url.split("/")[1]
      const userID = url.split("/")[3]
      workingArray = workingArray.filter((item) => { return item.RestaurantID == restaurantID && item.UserID == userID })
      const item = workingArray.length == 1 ? workingArray[0] : null
      return JSON.parse(JSON.stringify(item))
    }
